  true,\n\t\"url\": null,\n\t\"notes\": \"Following the death of a Veteran by suicide,
  BHAP receives post-mortem medical data and interviewee contact information from
  VHA suicide prevention coordinators. Data include relevant historical activities
  and related medical concerns as reviewed in the Veteran's medical record. Interviewees
  typically include a Veteran's family or close friends. Interviewee data includes
  behavioral information about the Veteran prior to their death. Data are collected
  at the VISN 2 Center of Excellence for Suicide Prevention and are cleaned, processed,
  and managed by statistical staff and program analysts on behalf of Mental Health
  Services.\",\n\t\"license_title\": \"Creative Commons CCZero\",\n\t\"extras\": [{\n\t\t\"key\":
